                        text: >-
                          Office Malagasy d’Etudes et de Régulation des
                          Télécommunications (OMERT), 
                      - type: text
                        text: >-
                          Antananarivo, announces the numbering plan of
                          Madagascar:
                  - type: bullet_list
                    content:
                      - type: list_item
                        content:
                          - type: paragraph
                            content:
                              - type: text
                                text: ' '
                              - type: text
                                marks:
                                  - type: em
                                text: "International numbering format:\_ +261 AB Z PQMCDU"
                  - type: paragraph
                    content:
                      - type: text
                        text: 'where:'
                  - type: paragraph
                    content:
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_ +\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_ international prefix"
                      - type: hard_break
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_ AB\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_ operator code (two digits for each operator)"
                      - type: hard_break
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_ Z\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_ area code (described as administrative area)"
                      - type: hard_break
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_ PQMCDU\_ subscriber number"
                  - type: bullet_list
                    content:
                      - type: list_item
