                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          Country code 261 for all existing telecommunication
                          networks in Madagascar.
                  - type: bullet_list
                    content:
                      - type: list_item
                        content:
                          - type: paragraph
                            content:
                              - type: text
                                marks:
                                  - type: em
                                text: AB – operator code
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          Each operator is identified by two digits described by
                          the characters AB:
                  - type: paragraph
                    content:
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_ 20-29\_\_\_\_\_\_\_\_\_ identification code for fixed service operators,"
                      - type: hard_break
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_ 30-39\_\_\_\_\_\_\_\_\_ identification code for mobile service operators"
                  - type: bullet_list
                    content:
                      - type: list_item
                        content:
                          - type: paragraph
                            content:
                              - type: text
                                marks:
                                  - type: em
                                text: >-
                                  Z – area code valid for Telecom Malagasy
                                  (fixed-service operator)
                  - type: paragraph
                    content:
                      - type: text
                        text: 'Madagascar is divided into six zones:'
                  - type: paragraph
                    content:
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_\_\_\_ Z = 2\_\_\_\_\_\_\_ Antananarivo zone"
                      - type: hard_break
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_\_\_\_ Z = 4\_\_\_\_\_\_\_ Antananarivo zone (rest of the province)"
                      - type: hard_break
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_\_\_\_ Z = 5\_\_\_\_\_\_\_ Toamasina zone"
                      - type: hard_break
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_\_\_\_ Z = 6 \_\_\_\_\_\_ Mahajanga zone"
                      - type: hard_break
                      - type: text
