                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          At national level, a closed numbering system of seven
                          digits is used. That is, all subscriber numbers
                          requested to the same operator Telecom Malagasy (local
                          and national) can be obtained by dialling seven digits
                          (ZPQMCDU).
                  - type: bullet_list
                    content:
